import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import InputBase from '@mui/material/InputBase';
import Divider from '@mui/material/Divider';
import IconButton from '@mui/material/IconButton';
import AddCircleIcon from '@mui/icons-material/AddCircle';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';

function CardForm(){
    return (
        <div style={{display: 'flex', justifyContent: 'center'}}>
        <Card sx={{ width: 500}} >
            <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                        To Do List
                </Typography>
                <Paper
                    component="form"
                    sx={{ p: '2px 4px', display: 'flex', alignItems: 'center', width: 450 }}
                    >

                    {/* <InputBase
                        sx={{ ml: 1, flex: 1 }}
                        placeholder="Informe uma tarefa"
                        inputProps={{ 'aria-label': 'Informe uma tarefa' }}
                    /> */}

                    <TextField sx={{ ml: 1, flex: 1 }} id="outlined-basic" label="Informe uma tarefa" variant="outlined" />
                    <Divider sx={{ height: 28, m: 0.5 }} orientation="vertical" />

                    <IconButton color="primary" sx={{ p: '10px' }} aria-label="directions">
                        <AddCircleIcon color="secondary" />
                    </IconButton>
                </Paper>

                <Box
                    component="form"
                    sx={{
                        '& > :not(style)': { m: 1, width: '25ch' },
                    }}
                    noValidate
                    autoComplete="off"
                    >
                    <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                    <TextField id="filled-basic" label="Filled" variant="filled" />
                    <TextField id="standard-basic" label="Standard" variant="standard" />
                </Box>
            </CardContent>
        </Card>
        </div>
      );
}

export default CardForm;
